def range_sum(numbers, start, end):
    sum_list = []
    for i in range(len(numbers)):
        if start <= numbers[i] <= end:
            sum_list.append(numbers[i])

    if len(sum_list) == 0:
        return 0
    else:
        return sum(sum_list)


